import { useState } from 'react'
const axios = require('axios')

const Index = ({ notes }) => {

  return (
    <div className='container'>
      <h3>Welcome to Blog Hub</h3>
      {
        notes.map((note) => {
          return (
            <div key={note._id}>
              <p>{note.title}</p>
            </div>
          )
        })
      }
    </div>
  )
}

Index.getInitialProps = async () => {
  let data
  await axios.get('http://localhost:3000/api/notes')
    .then(res => {
      data = res.data.data
    })

  return { notes: data }
}

export default Index
